import React, { Component } from "react";

import { getMovies } from "../Services/fakeMovieService";

class Movies extends Component {
  state = { movies: getMovies() };
  render() {
    return (
      <table className="table">
        <thead>
          <tr>
            <th>Title</th>
            <th>genre</th>
            <th>Stock</th>
            <th>Rate</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td />
            <td />
            <td />
            <td />
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Movies;
